import { Component } from '@angular/core';

@Component({
  selector: 'app-root',
  templateUrl: './app.component.html',
  styleUrls: ['./app.component.css']
})
export class AppComponent {
  title = 'counter_front';
}
<div>
  <app-button action="increment" label="Incrementar"></app-button>
  <app-button action="decrement" label="Decrementar"></app-button>
  <app-button action="reset" label="Resetear"></app-button>
  <app-button action="getValue" label="Mostrar Valor"></app-button>
</div>
